import { useHistory, useLocation, useRouteMatch } from "react-router-dom";

const Form = (props) => {
  const history = useHistory();
  const loc = useLocation();
  const params = useRouteMatch();

  console.log(loc);
  console.log(params);

  const handleClick = (e) => {
    console.log("AnaSayfa!");
    history.goBack();
  };

  return (
    <div>
      <h1>Form</h1>
      <p>
        <input type="button" value="AnaSayfa" onClick={handleClick} />
      </p>
    </div>
  );
};

module.exports = { Form };
